function nameSearch()
{
    document.getElementById("results0").innerHTML = "";
    document.getElementById("results1").innerHTML = "";
    document.getElementById("results2").innerHTML = "";
    var searchText = document.getElementById("nameSearchInput").value.toUpperCase().trim();
    var searchWords = searchText.split(" ");

    var found = false;
    if (searchText.length < 2)
    {
	return;
    }
    for (var i = 0; i < data.length; i += 3)
    {
	var index = 200;
	var index1 = -1;
	var index2 = -1;
	for (var j = 0; j < searchWords.length; j += 1)
	{
	    index1 = index1 == -1 ? data[i].toUpperCase().indexOf(searchWords[j]) : index1;
	    index2 = index2 == -1 ? data[i+1].toUpperCase().indexOf(searchWords[j]) : index2;
	    if (index1 != -1 && index1 < index)
	    {
		index = index1;
		found = true;
	    }
	    if (index2 != -1 && index2 < index)
	    {
		index = index2;
		found = true;
	    }
	}
	if (index === 0)
	{
	    found = true;
	    if (index1 === 0 && index2 === 0)
	    {
		document.getElementById("results0").innerHTML += "<tr><td style='width: 100px;'>"+data[i]+"</td><td style='width: 120px;'>"+data[i+1]+"</td><td>"+data[i+2]+"@franklinps.net</td></tr>";
	    } else
	    {
		document.getElementById("results1").innerHTML += "<tr><td style='width: 100px;'>"+data[i]+"</td><td style='width: 120px;'>"+data[i+1]+"</td><td>"+data[i+2]+"@franklinps.net</td></tr>";
	    }
	} else if (index != -1 && index != 200)
	{
	    found = true;
	    document.getElementById("results2").innerHTML += "<tr><td style='width: 100px;'>"+data[i]+"</td><td style='width: 120px;'>"+data[i+1]+"</td><td>"+data[i+2]+"@franklinps.net</td></tr>";
	}
	bothMatch = false;
	//console.log("Currently at: " + data[i+1]);
    }

    if (!found)
    {
	document.getElementById("results0").innerHTML = "<tr><td>No matches found.</td></tr>";
    }
}

function reverseButtonClick()
{
    document.getElementById("nameSearch").style.display = "none";
    document.getElementById("idSearch").style.display = "block";
    document.getElementById('idSearchInput').focus();
}

function nameButtonClick()
{
    document.getElementById("nameSearch").style.display = "block";
    document.getElementById("idSearch").style.display = "none";
    document.getElementById('nameSearchInput').focus();
}

function idSearch()
{
    var idNumber = document.getElementById("idSearchInput").value.trim();
    var result;
    var found = false;
    for (var i = 2; i < data.length; i += 3)
    {
	if (idNumber == data[i])
	{
	    result = data[i-2] + " " + data[i-1] + " " + data[i] + "@franklinps.net";
	    found = true;
	    break;
	}
    }
    if (!found)
    {
	result = "ID not found.";
    }
    document.getElementById("idResults").innerHTML = result;
}

document.addEventListener('DOMContentLoaded', function () {
    //alert('test');

    document.getElementById('nameSearchInput').focus();

    document.getElementById('nameSearchInput').addEventListener('change', nameSearch);
    document.getElementById('reverseButton').addEventListener('click', reverseButtonClick);
    document.getElementById('nameButton').addEventListener('click', nameButtonClick);
    document.getElementById('idSearchInput').addEventListener('change', idSearch);
});
